import ReactPlayer from "react-player"

class VideoPlayer extends Component {
    render() {
        return (
            <div>
                <ReactPlayer url={"https://www.youtube.com/watch?v=" + "ug50zmP9I7s"}/>
            </div>
        );
    }
}

export default VideoPlayer;
